import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract SafeWallet is Ownable {
    uint256 public startTime;
    ERC20 public token;

    struct VestingPeriod {
        uint month;
        address destinationAddress;
        uint amount;
        bool hasRun;
    }

    VestingPeriod[] vestingPeriods;

    function setVestingPeriod(uint _month, address _destinationAddress, uint _amount) public onlyOwner {
        vestingPeriods.push(VestingPeriod(_month, _destinationAddress, _amount, false));
    }

    function runMonthlyWithdrawal(uint month) onlyOwner public {
        for (uint i = 0; i < vestingPeriods.length; i++) {
            if (vestingPeriods[i].month == month && vestingPeriods[i].hasRun == false) {
                vestingPeriods[i].hasRun = true;
                token.transfer(vestingPeriods[i].destinationAddress, vestingPeriods[i].amount);
            }
        }
    }

    address[] public wallets = [

        //address public preseedWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public seedWalletAddress,
        0x0000000000000000000000000000000000000000,

        //address public privateWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public ingameSalesAddress;
        0x0000000000000000000000000000000000000000,

        //address public p2eRewardsWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public stakingRewardsWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public liquidityWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public marketingWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public treasuryWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public maReserveWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public teamWalletAddress;
        0x0000000000000000000000000000000000000000,

        //address public advisorsWalletAddress;
        0x0000000000000000000000000000000000000000

    ];

    address public preseedWalletAddress = wallets[0];
    address public seedWalletAddress = wallets[1];
    address public privateWalletAddress = wallets[2];
    address public ingameSalesAddress = wallets[3];
    address public p2eRewardsWalletAddress = wallets[4];
    address public stakingRewardsWalletAddress = wallets[5];
    address public liquidityWalletAddress = wallets[6];
    address public marketingWalletAddress = wallets[7];
    address public treasuryWalletAddress = wallets[8];
    address public maReserveWalletAddress = wallets[9];
    address public teamWalletAddress = wallets[10];
    address public advisorsWalletAddress = wallets[11];


    constructor(
        address _token
    ) {
        token = ERC20(_token);
        startTime = block.timestamp;
    }

    bool[] public hasWithdrawalBeenExecutedForMonth;

    function executeWithdrawlForMonth(uint month) public onlyOwner {
        // Calculate the timestamp for the specified month
        uint256 timestamp = startTime + (month * 30 days);
        // Check if the timestamp is in the past
        require(timestamp < block.timestamp, "The specified month is in the future");
        // Check if the withdrawal has already been executed
    }
}","keccak256":"0xd5f97153b34ad46a8ded06abe171dda94f2c00694b57b21b2326cd082993c63b"}},"version":1}
